/**
 * @summary Confirm user email
 */
export type getAuthEmailConfirmationResponse301 = {
  data: void;
  status: 301;
};

export type getAuthEmailConfirmationResponseDefault = {
  data: Error;
  status: Exclude<HTTPStatusCodes, 301>;
};
export type getAuthEmailConfirmationResponseError = (
  | getAuthEmailConfirmationResponse301
  | getAuthEmailConfirmationResponseDefault
) & {
  headers: Headers;
};

export type getAuthEmailConfirmationResponse =
  getAuthEmailConfirmationResponseError;

export const getGetAuthEmailConfirmationUrl = (
  params?: GetAuthEmailConfirmationParams
) => {
  const normalizedParams = new URLSearchParams();

  Object.entries(params || {}).forEach(([key, value]) => {
    if (value !== undefined) {
      normalizedParams.append(key, value === null ? "null" : value.toString());
    }
  });

  const stringifiedParams = normalizedParams.toString();

  return stringifiedParams.length > 0
    ? `/auth/email-confirmation?${stringifiedParams}`
    : `/auth/email-confirmation`;
};

export const getAuthEmailConfirmation = async (
  params?: GetAuthEmailConfirmationParams,
  options?: RequestInit
): Promise<getAuthEmailConfirmationResponse> => {
  return fetcher<getAuthEmailConfirmationResponse>(
    getGetAuthEmailConfirmationUrl(params),
    {
      ...options,
      method: "GET",
    }
  );
};

